import React from 'react';
import { View, Text, StyleSheet, TouchableOpacity, ScrollView } from 'react-native';
// Commenting out the chart import to troubleshoot blank screen issue
// import { LineChart } from 'react-native-chart-kit';

const DailyAnalysis = ({ analysis, onAnalyze }) => {
  // If no analysis available yet
  if (!analysis) {
    return (
      <View style={styles.container}>
        <Text style={styles.title}>Daily Analysis</Text>
        <Text style={styles.emptyText}>
          Complete your day to see performance analysis and insights.
        </Text>
        <TouchableOpacity style={styles.analyzeButton} onPress={onAnalyze}>
          <Text style={styles.analyzeButtonText}>Generate Analysis</Text>
        </TouchableOpacity>
      </View>
    );
  }

  // Mock data for productivity chart
  const productivityData = {
    labels: ['Morning', 'Afternoon', 'Evening'],
    datasets: [
      {
        data: [85, 70, 90],
        color: () => '#2ecc71', // Line color
        strokeWidth: 2
      }
    ],
  };

  // Mock data for mood chart
  const moodData = {
    labels: ['Morning', 'Afternoon', 'Evening'],
    datasets: [
      {
        data: [7, 8, 9],
        color: () => '#3498db', // Line color
        strokeWidth: 2
      }
    ],
  };

  return (
    <View style={styles.container}>
      <Text style={styles.title}>Daily Analysis</Text>

      <ScrollView style={styles.contentContainer}>
        <View style={styles.scoreCard}>
          <Text style={styles.scoreTitle}>Productivity Score</Text>
          <Text style={styles.scoreValue}>{analysis.productivityScore}%</Text>
          <View style={styles.scoreBar}>
            <View 
              style={[
                styles.scoreProgress, 
                { width: `${analysis.productivityScore}%` }
              ]} 
            />
          </View>
        </View>

        <Text style={styles.sectionTitle}>Productivity by Time</Text>
        {/* Temporarily removing charts for debugging
        <LineChart
          data={productivityData}
          width={320}
          height={180}
          chartConfig={{
            backgroundColor: '#ffffff',
            backgroundGradientFrom: '#ffffff',
            backgroundGradientTo: '#ffffff',
            decimalPlaces: 0,
            color: (opacity = 1) => `rgba(46, 204, 113, ${opacity})`,
            labelColor: (opacity = 1) => `rgba(0, 0, 0, ${opacity})`,
            style: {
              borderRadius: 16,
            },
          }}
          bezier
          style={styles.chart}
        /> */}
        <View style={styles.chartPlaceholder}>
          <Text style={styles.chartPlaceholderText}>Productivity Chart</Text>
        </View>

        <Text style={styles.sectionTitle}>Mood Tracking</Text>
        {/* Temporarily removing charts for debugging
        <LineChart
          data={moodData}
          width={320}
          height={180}
          chartConfig={{
            backgroundColor: '#ffffff',
            backgroundGradientFrom: '#ffffff',
            backgroundGradientTo: '#ffffff',
            decimalPlaces: 0,
            color: (opacity = 1) => `rgba(52, 152, 219, ${opacity})`,
            labelColor: (opacity = 1) => `rgba(0, 0, 0, ${opacity})`,
            style: {
              borderRadius: 16,
            },
            yAxisSuffix: '/10',
          }}
          bezier
          style={styles.chart}
        /> */}
        <View style={styles.chartPlaceholder}>
          <Text style={styles.chartPlaceholderText}>Mood Chart</Text>
        </View>

        <Text style={styles.sectionTitle}>Insights</Text>
        <View style={styles.insightsContainer}>
          <Text style={styles.insightText}>• {analysis.moodTrends}</Text>
          {analysis.suggestions.map((suggestion, index) => (
            <Text key={index} style={styles.insightText}>• {suggestion}</Text>
          ))}
        </View>

        <Text style={styles.sectionTitle}>Task Completion</Text>
        <View style={styles.statsContainer}>
          <View style={styles.statItem}>
            <Text style={styles.statValue}>12</Text>
            <Text style={styles.statLabel}>Tasks Completed</Text>
          </View>
          <View style={styles.statItem}>
            <Text style={styles.statValue}>85%</Text>
            <Text style={styles.statLabel}>Completion Rate</Text>
          </View>
          <View style={styles.statItem}>
            <Text style={styles.statValue}>3</Text>
            <Text style={styles.statLabel}>Tasks Missed</Text>
          </View>
        </View>
      </ScrollView>
    </View>
  );
};

const styles = StyleSheet.create({
  container: {
    backgroundColor: 'white',
    borderRadius: 12,
    padding: 16,
    marginVertical: 10,
    shadowColor: '#000',
    shadowOffset: { width: 0, height: 2 },
    shadowOpacity: 0.1,
    shadowRadius: 4,
    elevation: 3,
  },
  title: {
    fontSize: 20,
    fontWeight: 'bold',
    marginBottom: 15,
    color: '#333',
  },
  emptyText: {
    fontSize: 16,
    color: '#666',
    fontStyle: 'italic',
    marginBottom: 20,
  },
  analyzeButton: {
    backgroundColor: '#3498db',
    paddingVertical: 12,
    paddingHorizontal: 20,
    borderRadius: 6,
    alignItems: 'center',
  },
  analyzeButtonText: {
    color: 'white',
    fontWeight: 'bold',
    fontSize: 16,
  },
  contentContainer: {
    maxHeight: 500,
  },
  scoreCard: {
    backgroundColor: '#f5f5f5',
    borderRadius: 10,
    padding: 15,
    marginBottom: 20,
  },
  scoreTitle: {
    fontSize: 16,
    fontWeight: '500',
    marginBottom: 5,
    color: '#555',
  },
  scoreValue: {
    fontSize: 28,
    fontWeight: 'bold',
    color: '#2ecc71',
    marginBottom: 10,
  },
  scoreBar: {
    height: 10,
    backgroundColor: '#ddd',
    borderRadius: 5,
    overflow: 'hidden',
  },
  scoreProgress: {
    height: 10,
    backgroundColor: '#2ecc71',
    borderRadius: 5,
  },
  sectionTitle: {
    fontSize: 18,
    fontWeight: '600',
    marginTop: 15,
    marginBottom: 10,
    color: '#333',
  },
  chart: {
    marginVertical: 8,
    borderRadius: 10,
  },
  chartPlaceholder: {
    height: 180,
    backgroundColor: '#f0f0f0',
    borderRadius: 10,
    justifyContent: 'center',
    alignItems: 'center',
    marginVertical: 8,
  },
  chartPlaceholderText: {
    fontSize: 16,
    color: '#666',
  },
  insightsContainer: {
    backgroundColor: '#f5f5f5',
    borderRadius: 10,
    padding: 15,
    marginBottom: 15,
  },
  insightText: {
    fontSize: 16,
    color: '#555',
    marginBottom: 8,
    lineHeight: 22,
  },
  statsContainer: {
    flexDirection: 'row',
    justifyContent: 'space-between',
    marginBottom: 15,
  },
  statItem: {
    flex: 1,
    backgroundColor: '#f5f5f5',
    borderRadius: 10,
    padding: 12,
    alignItems: 'center',
    marginHorizontal: 5,
  },
  statValue: {
    fontSize: 20,
    fontWeight: 'bold',
    color: '#3498db',
    marginBottom: 5,
  },
  statLabel: {
    fontSize: 12,
    color: '#555',
    textAlign: 'center',
  },
});

export default DailyAnalysis;
